int a[(int) 2e5 + 5];
map<int, int> cnt;
int main() {
    ios_base::sync_with_stdio(false);
    cin.tie(0);
    cout.tie(0);
    int n, x;
    cin >> n >> x;
    for(int i = 1; i <= n; i++) {
        cin >> a[i];
        cnt[a[i]]++;
    }
    for(int i = 1; i <= n; i++) {
        if(cnt[x - a[i]] > 0) {
            for(int j = 1; j <= n; j++) {
                if(a[i] == x - a[j] and i != j) {
                    cout << i << ' ' << j;
                    return 0;
                }
            }
        }
    }
    cout << "IMPOSSIBLE";
}